private void setFields(Occur occur) {
  if (occur == Occur.MUST) {
    required = true;
    prohibited = false;
  } else if (occur == Occur.SHOULD) {
    required = false;
    prohibited = false;
  } else if (occur == Occur.MUST_NOT) {
    required = false;
    prohibited = true;
  } else {
    throw new IllegalArgumentException("Unknown operator " + occur);
  }
}

